import React, { useEffect, useState } from 'react'; 
import { useHistory, useParams } from 'react-router-dom';
import { fetchDisciplines } from '../api/countryAPI'; // изменено на fetchDisciplines
import { Container, Col, Card, Row, Table } from 'react-bootstrap'; // Импорт Table
import { DISCIPLINES_ROUTE } from '../utils/consts';

const DisciplinePage = () => {
    const [countries, setCountries] = useState([]); // Массив стран
    const { name } = useParams(); // Получение имени дисциплины из URL
    const history = useHistory();

    const containerStyle = {
        position: 'relative',
        backgroundImage: 'url(/images/bg.png)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        padding: '0px',
        height: '100vh',
        width: '100vw',
        color: "white",
    };

    const imgStyle = {
        display: 'block',
    };

    const i = {
        color: "white",
        border: '3px solid white',
        width: '300px',
        height: '60px',
        margin: '10px',
        borderRadius: '20px',
        backgroundColor: "rgba(255, 255, 255, 0.29)",
        cursor: "pointer",
    };

    const prev = {
        ...imgStyle,
        top: '15px',
        left: '10px',
        margin: "30px",
    };

    const logo = {
        ...imgStyle,
        top: '15px',
        left: '150px',
        margin: "15px",
        marginLeft: "71px",
        height: "57px",
    };

    const h1 = {
        color: "white",
        textAlign: "center",
    };

    const medal = {
        marginLeft: "10px",
        width: "40px",
    };

    // Фетчим данные на основе имени дисциплины из URL
    useEffect(() => {
        console.log("Fetching data for discipline:", name);
        if (name) {
            fetchDisciplines(name)  // Используем fetchDisciplines
                .then(data => setCountries(data))  // Данные всех стран с дисциплиной
                .catch(error => console.error("Error fetching disciplines:", error));
        }
    }, [name]);

    const handleMedalClick = (countryName, medalType) => {
        history.push(DISCIPLINES_ROUTE + `/${name}/${countryName}/${medalType}`);
    };

    if (countries.length === 0) {
        return <div>Loading...</div>;
    }

    return (
        <Container style={containerStyle}>
            <Row>
                <img style={prev} src='/images/ico-prev.svg' alt='paris' onClick={() => history.push(DISCIPLINES_ROUTE)} />
                <img style={logo} src='/images/logo-sm-white.png' alt='paris' />
            </Row>
            <Col className='p-0'>
                <h1 style={h1}>{name}</h1>
            </Col>

            {/* Таблица с данными о медалях */}
            <Col style={{ marginTop: '20px' }}>
                <Table striped bordered hover variant="dark">
                    <thead>
                        <tr>
                            <th>Country</th>
                            <th>GOLD</th>
                            <th>SILVER</th>
                            <th>BRONZE</th>
                            <th>TOTAL</th>
                        </tr>
                    </thead>
                    <tbody>
                        {countries.map((country, index) => (
                            <tr key={index}>
                                <td>{country.country}</td>
                                <td>{country.discipline.gold}</td>
                                <td>{country.discipline.silver}</td>
                                <td>{country.discipline.bronze}</td>
                                <td>{country.discipline.gold + country.discipline.silver + country.discipline.bronze}</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </Col>

            <Col>
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(name, 'gold')} style={i}>
                        <h5><img style={medal} src='/images/medals/gold.png' alt='gold'></img>Gold Medals</h5>
                    </Card>
                </Col>
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(name, 'silver')} style={i}>
                        <h5><img style={medal} src='/images/medals/silver.png' alt='silver'></img>Silver Medals</h5>
                    </Card>
                </Col>
                <Col md={4}>
                    <Card onClick={() => handleMedalClick(name, 'bronze')} style={i}>
                        <h5><img style={medal} src='/images/medals/bronze.png' alt='bronze'></img>Bronze Medals</h5>
                    </Card>
                </Col>
            </Col>
        </Container>
    );
};

export default DisciplinePage;
